function clearForm(form) {
  $(form).find("input, textarea, select").val("");
}

function submitForm(formId, api = '', columns = []) {
  $(formId).submit(function (e) {
    e.preventDefault();
    var form = $(this);
    var url = form.attr("action");
    $.ajax({
      type: "POST",
      url: url,
      data: form.serialize(),
      success: function (data) {
        console.log(data);
        var result = JSON.parse(data);
        showSweetAlert(
          result.status.toUpperCase(),
          result.message,
          result.status,
          2000
        );
        clearForm(form);
        if (api != '') {
          initializeDataTable(api, columns);
        }
      },
      error: function (data) {
        var result = JSON.parse(data);
        showSweetAlert(
          result.status.toUpperCase(),
          result.message,
          result.status,
          2000
        );
        clearForm(form);
      },
    });
  });
}

function submitLoginForm(formId) {
  $(formId).submit(function (e) {
    e.preventDefault();
    var form = $(this);
    var url = "assets/php/auth/sign-in.php";
    $.ajax({
      type: "POST",
      url: url,
      data: form.serialize(),
      success: function (data) {
        console.log(data);
        var result = JSON.parse(data);
        showSweetAlert(
          result.status.toUpperCase(),
          result.message,
          result.status,
          5000
        );
        clearForm(form);
        if (result.status == "success") {
          setTimeout(function () {
            window.location.href = "assets/php/auth/userAuth.php";
          }, 500);
        }
      },
      error: function (data) {
        var result = JSON.parse(data);
        showSweetAlert(
          result.status.toUpperCase(),
          result.message,
          result.status,
          5000
        );
        clearForm(form);
      },
    });
  });
}
